import React, {Component} from 'react';
import ListItems from '../ListItems';
import './List.css';

export default class List extends Component {


    render(){
      let {items, change} = this.props
        return (
            <ul>
                <ListItems items={items} change={change}/>
            </ul>
        )
    }
}
